import "./App.css";
import villagers from "./components/characters.json"



function App() {
  const [villagers, setVillagers] = useState([]);

  const getVillagers = () => {
    fetch('characters.json',{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
      });
  }

  useEffect(() => {
    getVillagers();
  }, []);

  return (
    <div className="App">
      <h2>Welcome to the Stardew Valley Visitors' Guide</h2>
    </div>
  );
}

export default App;
